const serviceEndpoint = 'https://localhost:5000';

export const addNumber = async (numberToAdd) => {
    const response = await fetch(
      `${serviceEndpoint}/add`,

      {
        method: 'POST',
        body: JSON.stringify({
            number: numberToAdd
        })
      }
    );
    // .then((response) => response.json());
}
